import './modal.css';
import { FiX } from 'react-icons/fi'

export default function Modal(conteudo, close){
  return(
    <div>
      <div className='container'>
        <button className='close' onClick={close}></button>
      </div>
      <h1>TESTE</h1>
    </div>
  )
}
